import react from "react";
import "./Skills.css";
import PourceBar from "./pourcentageBar/PourceBar";

const Skills = () => {
    return(
        <div id="skills">
            <PourceBar pourcentage="70" language="java"/>
            <PourceBar pourcentage="80" language="JS"/>
            <PourceBar pourcentage="80" language="Python"/>
            <PourceBar pourcentage="60" language="MySQL"/>
        </div>
    );
}

export default Skills;
